import jumbotron from '../static/images/JUMBOTRON.png'

export default function(){
    return (
        <div>
            <main>
                <h1>hi</h1>
            </main>
            <style jsx global>{`
                main {
                    background: url(${jumbotron});
                }
            `}</style>
        </div>
    )
}
